import React from 'react';
import ReactDOM from 'react-dom';
import "./index.css";

const name="sandeep Choudhary";

const img1="https://picsum.photos/200";
const img2="https://picsum.photos/200";

const img3="https://picsum.photos/200";
const img4="https://picsum.photos/200";
const img5="https://picsum.photos/200";

const heading={
	color:'blue',
	textAlign:'center',
	fontSize:'45px',
};


ReactDOM.render(

	<>
	<h1 style={heading}>My name is {name}</h1>
	<img src={img1}/>
	<img src={img2}/>
	<img src={img3}/>
	<img src={img4}/>
	<img src={img5}/>	

	</>


	,document.getElementById("root"));
